#include <iostream>
using namespace std;

void insertionSort(int arr[], int size){
    for(int i = 1; i<size; i++){
        int temp = arr[i];
        int j = i-1;
        while(j>=0 && arr[j]>temp){
            arr[j+1] = arr[j];
            j--;
        }
        arr[j+1] = temp;
    }

    cout << "[";
    for(int i = 0; i<size; i++){
        cout << arr[i]<< " ";
    }
    cout <<"]";
}

